package com.example.antriankesehatan.modelimport com.google.gson.annotations.SerializedNamedata class GetDoctorResponse(	@field:SerializedName("data")	val data: DataDokter,	@field:SerializedName("meta")	val meta: MetaDokter)data class DataItemDokter(	@field:SerializedName("bidang_dokter")	val bidangDokter: String,	@field:SerializedName("code")	val code: String,	@field:SerializedName("updated_at")	val updatedAt: String,	@field:SerializedName("nama_dokter")	val namaDokter: String,	@field:SerializedName("created_at")	val createdAt: String,	@field:SerializedName("id")	val id: Int,	@field:SerializedName("hari_praktek")	val hariPraktek: List<HariPraktekItem>,	@field:SerializedName("photo_dokter")	val photoDokter: String)data class LinksItem(	@field:SerializedName("active")	val active: Boolean,	@field:SerializedName("label")	val label: String,	@field:SerializedName("url")	val url: Any)data class DataDokter(	@field:SerializedName("per_page")	val perPage: Int,	@field:SerializedName("data")	val data: List<DataItemDokter>,	@field:SerializedName("last_page")	val lastPage: Int,	@field:SerializedName("next_page_url")	val nextPageUrl: Any,	@field:SerializedName("prev_page_url")	val prevPageUrl: Any,	@field:SerializedName("first_page_url")	val firstPageUrl: String,	@field:SerializedName("path")	val path: String,	@field:SerializedName("total")	val total: Int,	@field:SerializedName("last_page_url")	val lastPageUrl: String,	@field:SerializedName("from")	val from: Int,	@field:SerializedName("links")	val links: List<LinksItem>,	@field:SerializedName("to")	val to: Int,	@field:SerializedName("current_page")	val currentPage: Int)data class JamPraktekItem(	@field:SerializedName("hari_praktek_id")	val hariPraktekId: Int,	@field:SerializedName("jam_praktek")	val jamPraktek: String,	@field:SerializedName("updated_at")	val updatedAt: String,	@field:SerializedName("shift")	val shift: String,	@field:SerializedName("created_at")	val createdAt: String,	@field:SerializedName("id")	val id: Int)data class HariPraktekItem(	@field:SerializedName("updated_at")	val updatedAt: String,	@field:SerializedName("dokter_id")	val dokterId: Int,	@field:SerializedName("created_at")	val createdAt: String,	@field:SerializedName("jampraktek")	val jampraktek: List<JamPraktekItem>,	@field:SerializedName("id")	val id: Int,	@field:SerializedName("hari_praktek")	val hariPraktek: String)data class MetaDokter(	@field:SerializedName("code")	val code: Int,	@field:SerializedName("message")	val message: String,	@field:SerializedName("status")	val status: String)